import React from 'react'

export default class Welcome extends React.Component {
    constructor(props){
        super(props);
        this.state = {value: ''};

        this.handleChange = this.handleChangebind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    handleSubmit(event) {
        event.preventDefault();
    }

    render(){
        return (
            <div className='welcome'>
                <h1>Welcome to MMG</h1>

                <form className='form'>
                    <label>
                        First name:
                        <input type='text'  />
                    </label>

                    <label>
                        Last name:
                        <input type='text'  />
                    </label>

                    <label>
                        Email name:
                        <input type='text'  />
                    </label>

                    <label>
                        Difficulty:
                        <select>
                            <option value='easy'>Easy</option>
                            <option value='medium'>Medium</option>
                            <option value='hard'>Hard</option>
                        </select>
                    </label>

                    <label>
                        Select card shirt:
                        <input type="radio" name='opt' /> Opt 1
                        <input type="radio" name='opt' /> Opt 2
                        <input type="radio" name='opt' /> Opt 3
                    </label>

                    <p className='rules'>
                        Lorem, ipsum dolor sit amet consectetur adipisicing elit. 
                        Veritatis quidem consequuntur quis dolor reiciendis doloremque, 
                        quas voluptate assumenda, quibusdam nobis labore error facilis 
                        enim corporis voluptatem id vel maiores molestiae.
                    </p>

                    <input type='submit' value='Start Game' />
                </form>
            </div>
        );
    }
}
